CREATE TABLE `epu_t_package_extra` (
  `package_detail_id` int(11) NOT NULL AUTO_INCREMENT,
  `package_id` int(11) NOT NULL COMMENT '包裹编码',
  `order_source_code` varchar(12) DEFAULT NULL COMMENT '订单来源',
  `order_no` varchar(32) DEFAULT NULL COMMENT '物流订单号',
  `merchant_code` varchar(32) DEFAULT NULL COMMENT '商家编码',
  `merchant_name` varchar(100) DEFAULT NULL,
  `receive_name` varchar(100) DEFAULT NULL COMMENT '收件人姓名',
  `receive_cellphone` varchar(32) DEFAULT NULL COMMENT '手机号',
  `receive_fixphone` varchar(32) DEFAULT NULL,
  `receive_email` varchar(255) DEFAULT '' COMMENT '收件人邮箱',
  `receive_province_code` varchar(12) DEFAULT NULL COMMENT '收件人省编码',
  `receive_city_code` varchar(12) DEFAULT NULL COMMENT '收件人市编码',
  `receive_district_code` varchar(12) DEFAULT NULL COMMENT '收件人区编码',
  `receive_street_code` varchar(12) DEFAULT NULL COMMENT '收件人街道编码',
  `receive_detail_address` varchar(100) DEFAULT NULL COMMENT '收件人详细地址',
  `receive_whole_address` varchar(255) DEFAULT NULL COMMENT '完整收件人地址',
  `pay_way_code` varchar(12) DEFAULT NULL COMMENT '支付方式编码',
  `pay_rmb` decimal(15,5) DEFAULT NULL COMMENT '应付金额',
  `debt_rmb` decimal(15,5) DEFAULT NULL COMMENT '欠款金额',
  `pay_status` varchar(2) DEFAULT '00' COMMENT '支付状态（00-未支付，01-已支付）',
  `lock_status` varchar(2) DEFAULT '00' COMMENT '锁定状态(00-未锁定，01-已锁定) ',
  `lock_time` timestamp NULL DEFAULT NULL COMMENT '被锁时间',
  `lock_desc` varchar(12) DEFAULT NULL,
  `send_name` varchar(100) DEFAULT NULL,
  `send_cellphone` varchar(32) DEFAULT NULL,
  `send_fixphone` varchar(32) DEFAULT NULL,
  `send_province_code` varchar(12) DEFAULT NULL,
  `send_city_code` varchar(12) DEFAULT NULL,
  `send_district_code` varchar(12) DEFAULT NULL,
  `send_street_code` varchar(12) DEFAULT NULL,
  `send_detail_address` varchar(100) DEFAULT NULL,
  `send_whole_address` varchar(255) DEFAULT NULL COMMENT '发件人完整地址',
  `return_name` varchar(100) DEFAULT NULL,
  `return_cellphone` varchar(32) DEFAULT NULL,
  `return_fixphone` varchar(32) DEFAULT NULL,
  `return_province_code` varchar(12) DEFAULT NULL,
  `return_city_code` varchar(12) DEFAULT NULL,
  `return_district_code` varchar(12) DEFAULT NULL,
  `return_street_code` varchar(12) DEFAULT NULL,
  `return_detail_address` varchar(100) DEFAULT NULL,
  `return_whole_address` varchar(255) DEFAULT NULL COMMENT '退货人地址',
  PRIMARY KEY (`package_detail_id`)
) ENGINE=InnoDB AUTO_INCREMENT=181 DEFAULT CHARSET=utf8;
