-- Table structure for table `oms_t_child_station`
--

DROP TABLE IF EXISTS `oms_t_child_station`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `oms_t_child_station` (
  `station_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '站点编码',
  `station_name` varchar(100) DEFAULT NULL COMMENT '站点名称',
  `type` varchar(4) DEFAULT NULL COMMENT '站点类型',
  `business_time` varchar(50) DEFAULT NULL COMMENT '营业时间',
  `station_desc` varchar(1023) DEFAULT NULL COMMENT '站点描述',
  `province_code` varchar(12) DEFAULT NULL COMMENT '省编码',
  `city_code` varchar(12) DEFAULT NULL COMMENT '市编码',
  `district_code` varchar(12) DEFAULT NULL COMMENT '区编码',
  `street_code` varchar(12) DEFAULT NULL COMMENT '街道编码',
  `detail_address` varchar(100) DEFAULT NULL COMMENT '详细地址',
  `whole_address` varchar(255) DEFAULT NULL COMMENT '完整地址',
  `linkman` varchar(30) DEFAULT NULL COMMENT '责任人',
  `cellphone` varchar(30) DEFAULT NULL,
  `fixphone` varchar(30) DEFAULT NULL,
  `status` varchar(2) DEFAULT '00' COMMENT '锁定状态(00-不启用，01-启用，02-申请启用中)',
  `lock_time` datetime DEFAULT NULL COMMENT '被锁时间',
  `lock_desc` varchar(12) DEFAULT NULL COMMENT '被锁原因',
  `lock_count` int(11) DEFAULT NULL COMMENT '被锁次数',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`station_id`)
) ENGINE=InnoDB AUTO_INCREMENT=221 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

